// Import Swiper React components
import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/css";
import "swiper/css/effect-fade";
import "swiper/css/navigation";
import "swiper/css/pagination";
import Aws from "../Images/cloud-services.jpg";
import Testing from "../Images/software-testing-image.jpg";
import Development from "../Images/aws.jpg";

// import required modules
import { EffectFade, Autoplay, Navigation, Pagination } from "swiper";

export default function LandingPage() {
  return (
    <>
      <Swiper
        spaceBetween={30}
        effect={"fade"}
        navigation={true}
        autoplay={{
          delay: 2000,
          disableOnInteraction: false,
        }}
        pagination={{
          clickable: true,
        }}
        modules={[EffectFade, Navigation, Pagination, Autoplay]}
        className="mySwiper"
      >
        <SwiperSlide className="slide1 slides">
          <div className="row landing-row">
            <div className="col-5"></div>
            <div className="col-7 landing-text">
              <div className="text-hold">
                Web development is the process of designing, creating, and
                maintaining websites and web applications using various
                programming languages and technologies. It involves both
                front-end development, which focuses on the user interface and
                user experience, and back-end development, which deals with
                server-side programming and database management. Effective web
                development requires a combination of technical skills,
                creativity, and an understanding of web design principles, user
                experience, and accessibility.
              </div>
            </div>
          </div>
        </SwiperSlide>
      </Swiper>
    </>
  );
}
